import React from 'react';
import Link from "next/link";



class Navbar extends React.Component {
 
  render() {
   
    
    return (
      <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark fig-top">
          <a className="navbar-brand" href="#">Navbar</a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
            <div className="navbar-nav">
              <li className="nav-item nav-link " href="#">Home <span className="sr-only">(current)</span></li>
              <li className="nav-item nav-link "><Link href="/"><a>หน้าหลัก</a></Link></li>
              <li className="nav-item nav-link "><Link href="/about"><a>เกี่ยวกับเรา</a></Link></li>
            </div>
          </div>
        </nav>
        <style jsx>{`
        .nav-item {
          color: whitesmoke;
         ;
        }
      `}</style>
      </div>
    );
  }
}

export default Navbar;
